    EXPX  = exp(-1./2.*X.^2).*erfz(1./2.*1i.*X.*2.^(1./2)); EXPX(isnan(EXPX))=0;EXPX(isinf(EXPX))=0;

	% Cell Array of precomputed functions
    hphin = cell(1, 21);
	hphin{1}  = @(t) -1i./pi.^(1./4).*EXPX;
	hphin{2}  = @(t) -1./pi.^(3./4).*(2+t.*pi.^(1./2).*2.^(1./2).*EXPX.*1i);
